import React from "react";
import "./App.css";
import NavBar from "./components/navbar/navbar";
import Title from "./components/centerpanel/header";
import "bootstrap/dist/css/bootstrap.css";
import { library } from "@fortawesome/fontawesome-svg-core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faLayerGroup,
  faThLarge,
  faPlus,
  faCog
} from "@fortawesome/free-solid-svg-icons";

library.add(faLayerGroup, faThLarge, faPlus, faCog);

function App() {
  return (
    <div className="App">
      <NavBar isHorizontal={true} />
      <div className="row" id="container" style={{ position: "relative" }}>
        <NavBar isHorizontal={false} />
        <div className="float-lg-right central-panel-container">
          <Title />
        </div>
      </div>
    </div>
  );
}

export default App;
